import React, { useState, useEffect } from 'react';
import Axios from "axios";
import { Typography, Button } from "@mui/material";

const Summary = (props) => {

    const [daily, setDaily] = useState({
        user: props.user,
        stamp: "",
        data: null

    })

    useEffect(() => {
        Axios.get("http://magfooddiary-env.eba-bh6g2nuu.us-east-2.elasticbeanstalk.com/day")
        .then(result => setDaily({ ...daily, stamp: result.data.stamp }))
    }, [])

    useEffect(() => {
        Axios.get(`http://magfooddiary-env.eba-bh6g2nuu.us-east-2.elasticbeanstalk.com/summary/${daily.user}/${daily.stamp}/`)
    }, [])
    return (
        <div>
            Summary
        </div>
    )
}
export default Summary;
